import React from 'react';
import './User.css';
import {Navbar, Container} from 'react-bootstrap';

function User() {
    return (
        <div>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Navbar.Brand href="#home" className="navbarbrand">
                    </Navbar.Brand>
                </Container>
            </Navbar> 
        </div>
    )
}

export default User
